import React from 'react';
import { useState, useEffect } from 'react';

const MP = () => {
  const [forYou, setForYou] = useState([]);
  const [SearchMovies, setSearchMovies] = useState([]);
  const [liked, setLiked] = useState([]);

  useEffect(() => {
      fetch(`http://localhost:8000/foryou/`)
      .then((response) => response.json())
      .then((data) => setForYou(data));

      fetch(`https://api.themoviedb.org/3/search/movie?query=irishman&api_key=2da959128bf01c42309d7a6b378a64df&language=en-US&page=1`)
      .then((response) => response.json())
      .then((data) => setSearchMovies(data.results));

      fetch(`http://localhost:8000/liked/`)
      .then((response) => response.json())
      .then((data) => setLiked(data));

  }, []);

  const renderTitles = () => {
    const titles = [];

    // Iterate over main titles
    for (const mainTitle in liked) {
      const titleData = jsonData[mainTitle];

      // Iterate over items in each main title
      for (const index in titleData) {
        const item = titleData[index];
        titles.push(
          <div key={`${mainTitle}-${index}`}>
            <p>{item.title}</p>
          </div>
        );
      }
    }

    return titles;
  };

  return (
        <div className="rounded-md shadow-md text-left font-b">
        <nav class="flex items-center justify-between flex-wrap p-6">
        <div class="flex items-center flex-shrink-0 text-white mr-6">
        <div> <img className='rounded-full w-12' src={require('./Image.jpeg')} alt ="PRP image"/></div>
          <span class="ml-4 text-3xl tracking-tight max-sm:hidden lg:shown ">OMAR</span>
          <button className="max-sm:ml-4 ml-8 w-24 rounded-full border-2 border-gray-700 p-1 text-gray-500 hover:text-cyan-300 hover:border-cyan-300  transition duration-300 text-xl focus:outline-none"> SERIES </button>
          <button className="ml-2 w-24 rounded-full border-2 border-gray-700 p-1 text-gray-500 hover:text-cyan-300 hover:border-cyan-300  transition duration-300 text-xl focus:outline-none"> FILMS </button>
          <button id="dropdown-button" data-dropdown-toggle="dropdown" className="flex-shrink-0 z-10 inline-flex items-center py-1 px-4 ml-2 w-32 rounded-full border-2 border-gray-700 p-1 text-gray-500 hover:text-cyan-300 hover:border-cyan-300  transition duration-300 text-xl focus:outline-none" type="button">CATEGORIES <svg class="w-2.5 h-2.5 ms-2.5" aria-hidden="true" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 10 6">
    <path stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="m1 1 4 4 4-4"/>
  </svg></button>
        </div>

        <div class="block">
        <form>   
        <label for="default-search" class="mb-2 text-sm font-medium text-gray-900 sr-only dark:text-white">Search</label>
        <div class="relative">
        <input type="search" id="default-search" className="lg:w-80 block max-sm:hidden w-full bg-transparent text-gray-700 focus:text-white rounded-full border-2 border-gray-700 p-2 focus:outline-none focus:border-cyan-300" placeholder="RECHERCHER" required/>
        <button type="submit" class="text-white absolute max-sm:bottom-0 end-3 bottom-3.5">
            <svg class="w-4 h-4 max-sm:w-6 max-sm:h-6 text-gray-500 dark:text-gray-400" aria-hidden="true" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 20 20">
                <path stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="m19 19-4-4m0-7A7 7 0 1 1 1 8a7 7 0 0 1 14 0Z"/>
            </svg></button>
        </div>
        </form>
        </div>
      </nav>
      <div className="mt-5">
      <button className="ml-8 w-24 rounded-full border-2 border-cyan-300 p-1 text-cyan-300 hover:text-gray-300 hover:border-gray-300  transition duration-300 text-xl focus:outline-none"> COMEDY </button>
      <button className="ml-2 w-24 rounded-full border-2 border-cyan-300 p-1 text-cyan-300 hover:text-gray-300 hover:border-gray-300  transition duration-300 text-xl focus:outline-none"> CRIME </button>
      <button className="ml-2 w-24 rounded-full border-2 border-cyan-300 p-1 text-cyan-300 hover:text-gray-300 hover:border-gray-300  transition duration-300 text-xl focus:outline-none"> BIOGRAPHY </button><br />

      <div> 

      {SearchMovies .slice(0, 1).map((movie) => (
        <div key={movie.id}>

        <div className="grid grid-cols-2 gap-8">
            <div>
            <h1 className="text-6xl mt-8 ml-10 text-white">{movie.title}</h1>
            <p className="text-2xl mt-4 ml-10 text-gray-300">{movie.overview}</p>

        </div>
        <div className="relative mr-8 max-sm:mt-8 bottom-7 max-sm:bottom-0 ">
            <img className="absolute inset-y-0 right-0 rounded-2xl w-64" src={`https://image.tmdb.org/t/p/w500${movie.poster_path}`} alt={movie.title}/>
        </div>
        </div>

        </div>
      ))}</div>
      </div>
      <div>
      <button className="ml-8 mt-16 w-60 rounded-full border-2 border-cyan-300 p-1 text-cyan-300 hover:text-gray-300 hover:border-gray-300  transition duration-300 text-xl focus:outline-none"> WATCH </button>
      </div>

      <div className="mt-16">
      <h1 className="text-3xl mt-4 ml-10 text-white">POUR VOUS</h1>
      <div className="ml-8 mt-4 grid grid-cols-8 max-sm:grid-cols-2 max-md:grid-cols-4 max-lg:grid-cols-7 gap-3">

      {forYou.slice(0, 8).map((movie) => (
        <div key={movie.id}>
            <img className="rounded-2xl hover:border-2 hover:border-gray-500 transition duration-300 w-full h-auto" src={`https://image.tmdb.org/t/p/w500${movie.poster_path}`} alt={movie.title}/>
        </div>
      ))}
      </div>
      </div>

      <div>
      <h1>Your React Component</h1>
      {renderTitles()}
    </div>

      </div>
    );
  };
  export default MP;
